import React from 'react';
import Book from './Book';
import css from ''

const book1 = {
  nameOfTheBook: "Concise Laws Of Human Nature",
  nameOfTheAuthor: "Robert Greene",
  Rating: 4,
  price: 20
};

const book2 = {
  nameOfTheBook: "48 Laws Of Power",
  nameOfTheAuthor: "Robert Greene",
  Rating: 5,
  price: 30
};

const BookList = () => {
  return (
    <div>
      <Book 
        name={book1.nameOfTheBook} 
        author={book1.nameOfTheAuthor} 
        rating={book1.Rating} 
        price={book1.price} 
      />
      <Book 
        name={book2.nameOfTheBook} 
        author={book2.nameOfTheAuthor} 
        rating={book2.Rating} 
        price={book2.price} 
      />
    </div>
  );
};

export default BookList;
